import React from "react";
import { NavLink } from "react-router-dom";

function Component(props) {
  return (
    <>
      <section id="header" className="d-flex align-items-center">
        <div className="container-fluid">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center align-items-center flex-column">
                  <h1>
                    {props.text}
                    {props.strongContent}
                  </h1>
                  <h2 className="my-3">{props.text2}</h2>
                  <div className="mt-3">
                    <NavLink to={props.visit} className="btn-get-started">
                      {props.btname}
                    </NavLink>
                  </div>
                </div>
                <div className="col-lg-6 order-1 order-lg-2 header-img img-size">
                  <img src={props.imgsrc} style={props.imgStyle} className="img-fluid animated" alt="#" />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}

export default Component;
